import React from "react";
import logo from "../../assets/Logo.png";
import logout from "../../assets/logout.png";
import ButtonSecondary from "../ButtonSecondary";
import { useNavigate } from "react-router-dom";

/**
 * Navbar component
 */
const Nav = () => {
  const navigate = useNavigate();

  return (
    <nav className="w-full px-4 py-3 flex items-center gap-2 relative">
      <img src={logo} alt="Logo" />

      <div className="ml-auto">
        <ButtonSecondary
          onClick={() => {
            setUser(null);
            navigate("/login");
          }}
        >
          <img src={logout} alt="Logout" />
          Log out
        </ButtonSecondary>
      </div>

      <div className="bg-purple-normal/50 w-52 h-52 blur-3xl absolute -top-16 -right-16 z-[-1]" />
    </nav>
  );
};

export default Nav;
